import React from 'react';
import imagenes from "../assets/imagenes";

const Home = _ => {
   
  return(
    <div>
      <h2 className="text-center">Home</h2>  
              
        <img src={imagenes.img1}/>
                    
    </div>             
  )    
  
  }

export default Home;
